DELIMITER $$
--
-- Funciones
--
DROP FUNCTION IF EXISTS `CAP_FIRST`$$
CREATE DEFINER=`root`@`localhost` FUNCTION `CAP_FIRST`(input VARCHAR(255)) RETURNS varchar(255) CHARSET utf8
    DETERMINISTIC
BEGIN
-- Usage:  UPDATE table_name SET fiel_dname=CAP_FIRST(field_name);`
-- to further replace unwanted caps, eg: UPDATE table_name SET field_name=replace(field_name, ' De ', ' de ');`
	DECLARE len INT;
	DECLARE i INT;

	SET len   = CHAR_LENGTH(input);
	SET input = LOWER(input);
	SET i = 0;

	WHILE (i < len) DO
		IF (MID(input,i,1) = ' ' OR i = 0) THEN
			IF (i < len) THEN
				SET input = CONCAT(
					LEFT(input,i),
					UPPER(MID(input,i + 1,1)),
					RIGHT(input,len - i - 1)
				);
			END IF;
		END IF;
		SET i = i + 1;
	END WHILE;

	RETURN input;
END$$

DELIMITER ;

